import React from 'react';
import './App.css';
import Dashboard from './views/dashboard/dashboard'
const DashboardComponent = React.lazy(() => import('./views/dashboard/dashboard'));
const SignInComponent = React.lazy(() => import('./views/loginManager/sign-in/signIn'));
// import SignIn from './views/loginManager/sign-in/signIn'
import 'bootstrap/dist/css/bootstrap.min.css';
// import { Container, Row, Col } from 'react-bootstrap';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (
    <Router>
      <div className="Layout">
        <Switch>
          <Route path="/web/dashboard">
            <DashboardComponent />
          </Route>
          <Route path="/">
            <SignInComponent></SignInComponent>
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
